import DrawingCanvas from './components/DrawingCanvas'
import Layout from '../../components/Layout';


class DigitRecognizer extends React.Component {
  render(){
    return (
      <div className="Page">
        <h1>Draw any digit from 0-9</h1>
        <DrawingCanvas/>
        <style >{`
          .Page{
            text-align: center;
          }
          .button-wrapper{
            padding-top: 5vh;
          }
          .signatureCanvas{
            border: solid gray;
          }
          `}</style>
      </div>
    );
  }
}

export default DigitRecognizer;
